export default function selectAlg(value) {
    switch(value) {
      case value:
        this.setState({selectedAlg: value})
        break

        // case 2:
        //   this.setState({selectedAlg: 2})
        // break

        // case 3:
        //   this.setState({selectedAlg: 3})
        // break
      
      default:
        console.log("You selected an algorithm!")
        break
    }
  }
